import React from "react";
import "../css/nav.css";
import logo from "../images/logo.png";

const Nav = () => {
  return (
    <div className="nav">
      <ul>
        <img src={logo} height="50px" width="100px"></img>
        <li>
          <a href="">Home</a>
        </li>
        <li>
          <a href="">About</a>
        </li>
        <li>
          <a href="">Menu</a>
        </li>
        <li>
          <a href="">Reservations</a>
        </li>
        <li>
          <a href="">Order online</a>
        </li>
        <li>
          <a href="">Login</a>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
